def create_syndicated_deal(happy_hour, deal_place):
    description = happy_hour.description
    start = happy_hour.start
    end = happy_hour.end
    days = happy_hour.days
    days_active = happy_hour.days_active
    syndicated_deal = SyndicatedDeal(description=description, start=start, end=end, days=days, days_active=days_active, place=deal_place)
    syndicated_deal.save()
    return syndicated_deal


def create_deal_place(place):
    name = place.name
    latitude = place.latitude
    longitude = place.longitude
    street_address = place.street_address
    phone = place.phone
    image_url = place.image_url
    yelp_id = place.yelp_id
    yelp_rating_image_url = place.yelp_rating_image_url
    yelp_review_count = place.yelp_review_count
    foursquare_id = place.foursquare_id
    facebook_id = place.facebook_id
    place_description = place.place_description
    deal_place = DealPlace(name=name, latitude=latitude, longitude=longitude, street_address=street_address, phone=phone,
              image_url=image_url, yelp_id=yelp_id, yelp_rating_image_url=yelp_rating_image_url,
              yelp_review_count=yelp_review_count, foursquare_id=foursquare_id, facebook_id=facebook_id,
              place_description=place_description)
    deal_place.save()
    return deal_place


